import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
  useLocation,
} from "react-router-dom";
import Header from "./components/Header";
import BackgroundVideo from "./components/BackgroundVideo";
import ArtistDashboard from "./components/board/ArtistDashboard";
import UserDashboard from "./components/board/UserDashboard"; // Make sure this exists
import Profile from "./components/board/Profile";
import Login from "./components/auth/Login";
import Register from "./components/auth/Register";

function App() {
  const token = localStorage.getItem("token");
  const userRole = (localStorage.getItem("role") || "").toLowerCase();

  return (
    <Router>
      <AppContent token={token} userRole={userRole} />
    </Router>
  );
}

function AppContent({ token, userRole }) {
  const location = useLocation();

  return (
    <div className="app-container">
      {/* üé• Background video only on login/register */}
      {(location.pathname === "/login" || location.pathname === "/register") && (
        <BackgroundVideo />
      )}

      {/* üß≠ Navigation */}
      <Header />

      <Switch>
        {/* üîó Default route based on role */}
        <Route exact path="/">
          {token ? (
            userRole === "artist" ? (
              <Redirect to="/artist-dashboard" />
            ) : (
              <Redirect to="/dashboard" />
            )
          ) : (
            <Redirect to="/login" />
          )}
        </Route>

        {/* üîê Auth routes */}
        <Route exact path="/login" component={Login} />
        <Route exact path="/register" component={Register} />

        {/* üé® Artist Dashboard - Only for artists */}
        <Route
          exact
          path="/artist-dashboard"
          render={(props) =>
            token && userRole === "artist" ? (
              <ArtistDashboard {...props} />
            ) : (
              <Redirect to="/login" />
            )
          }
        />

        {/* üõí User Dashboard - Only for buyers */}
        <Route
          exact
          path="/dashboard"
          render={(props) =>
            token && userRole === "buyer" ? (
              <UserDashboard {...props} />
            ) : (
              <Redirect to="/login" />
            )
          }
        />

        {/* üë§ Artist Profile - Only for artists */}
        <Route
          exact
          path="/profile"
          render={(props) =>
            token && userRole === "artist" ? (
              <Profile {...props} />
            ) : (
              <Redirect to="/login" />
            )
          }
        />

        {/* ‚ùå 404 page */}
        <Route path="*">
          <div className="text-center py-10">
            <h2 className="text-3xl font-bold text-red-500">404 - Page Not Found</h2>
          </div>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
